        label: 'RÚIAN speciální data - volební okrsky - stav',
        description: 'Data vychází z Registru územní identifikace, adres a nemovitostí (RÚIAN), který je součástí základních registrů České republiky a obsahuje informace o územní identifikaci, adresách a nemovitostech. Data jsou poskytována ve výměnném formátu RÚIAN (VFR), ve kterém jsou zapsána jazykem XML a odpovídají formátu GML 3.2.1 (podle ISO 19136:2007). Pro stažení jsou datové sady komprimovány jako archivy Gzip. Stavový soubor s volebními okrsky se generuje vždy aktuální k třetímu dni každého měsíce. Volební okrsky jsou účelovým územním prvkem vedeným v RÚIAN a jsou beze zbytku skladebné do území obcí, resp. území městských částí/městských obvodů (MOMC) územně členěných statutárních měst a tím odvozeně do území celé ČR. Soubor obsahuje všechny volební okrsky a jejich atributy: kód, definiční bod, hranice, platnost, kód obce, kód MOMC a ID návrhu změny, kterým byl volební okrsek naposledy změněn.',
