        'term.parent.help': '(Nepovinný) pojem s širším významem. Slouží k zachycení vazby na obecnější pojem (např. \'Kostel\' -> \'Budova\'), k přiřazení pojmu jeho typu (např. \'Kostel sv. Ludmily na Chvalech\' -> \'Kostel\'), nebo k vyjádření části celku (např. \'Klika\' -> \'Dveře\')',
        'term.types.help': '(Nepovinný) charakter pojmu. Rozlišujeme typy a individuály - Typem je například \'Městská část\', individuálem pak \'Střešovice\'. Individuály jsou dále rozděleny na \'Objekty\', \'Vlastnosti\', \'Vztahy\' a \'Události\', typy analogicky na \'Typy objektů\', \'Typy vlastností\', \'Typy vztahů\' a \'Typy událostí\'. \'Objekty\' (např. konkrétní městské části, auta, lidé, dokumenty) označují nezávislé, v čase se měnící prvky, zatímco \'Vlastnosti\' (např. barva vlasů konkrétního člověka) jsou prvky závislé na \'Objektech\'. Podobně \'Vztahy\' (např. manželství dvou konkrétních lidí)  propojují dva objekty a jsou na nich závislé. Události (např. \'Volby do PSP 2016\') jsou naopak prvky neměnné,  které kompletně proběhly v minulosti. Například \'Olympiáda 2022\' se stane událostí až po svém skončení. Typy označují skupiny/kategorie individuálů. \'Typem objektu\' tedy může být např. \'Městská část\', nebo \'Auto\'. \'Barva vlasů\' by byl \'Typ vlastnosti\'. \'Typem vztahu\' je obecně \'Manželství\' a je závislé na dvou \'Typech objektů\'. Příkladem \'Typu události\' jsou \'Olympijské hry\'.  V případě, že si nejste jistí, ponechte pole prázdné.',
        'term.source.help': '(Nepovinný) odkaz na původ definice pojmu. Odkazuje na konkrétní místo v textu dokumentu, například na kapitolu knihy, či konkrétní odstavec v zákoně, např. \'Písmeno b) paragrafu 2 zákona č. 256/2013 Sb., o katastru nemovitostí\'. V případě označení definice v textu dokumentu je zdroj vyplňován automaticky.',
